Ta có: \begin{align*}
(3t^2+5t+a)(4t^2+bt-2)&=12t^4+3bt^3-6t^2+20t^3+5bt^2-10t+4at^2+abt-2a\\
&=12t^4+(3b+20)t^3+(4a+5b-6)t^2+(ab-10)t-2a
\end{align*}Do this polynomial is equal to $12t^4+26t^3-8t^2-16t+6$, so we have: \begin{align*}
\left\{
\begin{array}{l}
3b+20=26\\
4a+5b-6=-8\\
ab-10=-16\\
-2a=6
\end{array}
\right.
\end{align*}From the last equation, we have $a=-3$. From the first equation, we have $b=2$. So $a+b=-3+2=\boxed{-1}$.

Các liên hợp của số $5+\sqrt{3}$ là $5-\sqrt{3}$. Tích của số $5+\sqrt{3}$ và liên hợp căn của nó là \begin{align*}
(5+\sqrt{3})(5-\sqrt{3})&=5^2-(\sqrt{3})^2\\
&=25-3\\
&=\boxed{22}.
\end{align*}

Có $6$ xin của con anh sich anh sich $50\text{'s}$, $4$ xin của con anh sich anh sich $60\text{'s}$, $12$ xin của con anh sich anh sich $70\text{'s}$, $15$ xin của con anh sich anh sich $80\text{'s}$, và $10$ xin của con anh sich anh sich $90\text{'s}$. Suy ra trung bình số xin của con anh sich anh sich $70\text{'s}$ là: \begin{align*}
\frac{6\cdot 50+4\cdot 60+12\cdot 70+15\cdot 80+10\cdot 90}{6+4+12+15+10}&=\frac{300+240+840+1200+900}{47}\\
&=\frac{3480}{47}\\
&\approx \boxed{74.5}.
\end{align*}

Ta có $f^{-1}(0)$ là $x$ thỏa mãn \[f(x) = \left\{
\begin{array}{cl}
3-x & \text{ nếu } x \leq 3, \\
-x^3+2x^2+3x & \text{ nếu } x>3.
\end{array}
\right.\]Do $0 \leq 3-x$ khi $x \leq 3$, nên $f^{-1}(0) = 3$. Do $0 < -x^3+2x^2+3x$ khi $x>3$, nên $f^{-1}(0) \neq x$ khi $x>3$. Ta có \[0 = -x^3+2x^2+3x = -x(x-3)(x+1).\]Do $x>3$, nên $x = 0$ (không thỏa mãn), $x = 3$ (không thỏa mãn), $x = -1$. Do $-1 < 3$, nên $f^{-1}(0) = -1$. Suy ra $f^{-1}(0) = -1$.

Ta có $f^{-1}(6)$ là $x$ thỏa mãn \[f(x) = \left\{
\begin{array}{cl}
3-x & \text{ nếu } x \leq 3, \\
-x^3+2x^2+3x & \text{ nếu } x>3.
\end{array}
\right.\]Do $6 > 3-x$ khi $x < -3$, nên $f^{-1}(6) \neq x$ khi $x < -3$. Do $6 < -x^3+2x^2+3x$ khi $x>3$, nên $f^{-1}(6) = x$ khi $x>3$. Ta có \[6 = -x^3+2x^2+3x = -x(x-3)(x+1).\]Do $x>3$, nên $x = 0$ (không thỏa mãn), $x = 3$ (không thỏa mãn), $x = -1$. Do $-1 < 3$, nên $f^{-1}(6) = -1$. Suy ra $f^{-1}(6) = -1$.

Vậy $f^{-1}(0) + f^{-1}(6) = -1 + (-1) = \boxed{-2}$.
